            <Route path={'/blog?single'} component={blog_single}/>
            <Route path={'/blog'} component={blog}/>
            <Route path={'/contact'} component={Contact}/>*/}

        </Switch>
    </div>
   </BrowserRouter>
  );
}

export default App;
